import React from 'react';
import { BrowserRoutes, Switch, Route} from 'react-router-dom';

import Home from './core/Home';
const Routes = () => {
    return (
        <BrowserRoutes>
            <Switch>
                <Route path = '/' exact component ={Home} />
            </Switch>
        </BrowserRoutes>
    )
}

export default Routes;
